css:
.nuclide-device-panel-android-emulator-row {
  display: flex;
  justify-content: space-between;
}
.nuclide-device-panel-android-emulator-running {
  color: #e8e6df;
}
.nuclide-device-panel-android-emulator-header {
  display: flex;
  justify-content: space-between;
  width: 100%;
}
.nuclide-device-panel-android-emulator-empty-message {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
.nuclide-device-panel-android-tunnel-control {
  order: -1;
}
.nuclide-device-panel-android-tunnel-control.active {
  color: #6699cc;
}
.nuclide-device-panel-android-tunnel-control.active:hover {
  color: #6699cc;
}
.nuclide-device-panel-android-tunnel-control.inactive {
  color: #747369;
}
